import Vue from 'vue'
import VueRouter from 'vue-router'
import Main from '../views/Main.vue'
import home from '../views/home'
import User from '../views/User'

Vue.use(VueRouter)

const routes = [
    {
       path: '/',
       name: 'Main',
       component: Main,
       children: [
           {
             path: '/home',
             name: 'home',
             component: home  
           },
           {
            path: '/user',
            name: 'user',
            component: User  
        }
       ]
    },

]

const router = new VueRouter({
    mode: 'history',
    routes
})
export default router
